import React from 'react';
import logo from "../../Image/logo1.png";
import {Link} from "react-router-dom";



const Header = () => {
  return (
    <>
     <nav className='navbar'>
      <div className="logo">
        <img src={logo} alt="logImg" />
      </div>

      <div className="nav-link">
        <Link to ="/">Home</Link>
      </div>
     </nav>
    </>
  )
}

export default Header
